import {BrowserRouter, Routes, Route } from "react-router-dom";
import PageHeader from "./Navbar/Header";
import "../assets/styles/global.css"

export default function App(){
      return (
             <BrowserRouter>
                     <PageHeader>
                             <Routes>
                                       <Route  path="/"  element={PageHeader} />
                                       <Route  path="/" element={PageHeader} />
                                       <Route  path="/"  element={PageHeader} />
                             </Routes>
                     </PageHeader>
             </BrowserRouter>
      )
}
